import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const LoginContainer = styled.div`
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  background: ${props => props.theme.colors.background};
  padding: 2rem;
  position: relative;
  overflow: hidden;
`;

const BackgroundGradient = styled(motion.div)`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: ${props => props.theme.gradients.dark};
  z-index: 0;
`;

const BackgroundBlur = styled(motion.div)`
  position: absolute;
  width: 60vw;
  height: 60vw;
  border-radius: 50%;
  background: ${props => props.theme.gradients.primary};
  filter: blur(80px);
  opacity: 0.2;
  z-index: 1;
`;

const LoginForm = styled(motion.form)`
  background: ${props => props.theme.colors.surface};
  padding: 2.5rem 2rem;
  border-radius: ${props => props.theme.borderRadius.medium};
  box-shadow: ${props => props.theme.shadows.large};
  width: 100%;
  max-width: 420px;
  border: 1px solid ${props => props.theme.colors.border};
  backdrop-filter: blur(10px);
  position: relative;
  z-index: 10;
`;

const Title = styled(motion.h1)`
  color: ${props => props.theme.colors.text};
  text-align: center;
  margin-bottom: 2rem;
  font-size: 2rem;
  font-weight: 700;

  span {
    color: ${props => props.theme.colors.primary};
  }
`;

const FormGroup = styled(motion.div)`
  margin-bottom: 1.75rem;
`;

const Label = styled.label`
  display: block;
  margin-bottom: 0.5rem;
  color: ${props => props.theme.colors.text};
  font-weight: 500;
`;

const Input = styled.input`
  width: 100%;
  padding: 0.75rem 1rem;
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: ${props => props.theme.borderRadius.small};
  background: ${props => props.theme.colors.input};
  color: ${props => props.theme.colors.text};
  transition: ${props => props.theme.transition.standard};

  &:focus {
    outline: none;
    border-color: ${props => props.theme.colors.primary};
    box-shadow: 0 0 0 3px rgba(255, 77, 90, 0.15);
  }
`;

const Button = styled(motion.button)`
  width: 100%;
  padding: 0.85rem;
  background: ${props => props.theme.colors.primary};
  color: white;
  border: none;
  border-radius: ${props => props.theme.borderRadius.small};
  cursor: pointer;
  font-size: 1rem;
  font-weight: 600;
  transition: ${props => props.theme.transition.standard};
  margin-top: 1rem;

  &:hover {
    background: ${props => props.theme.colors.primaryDark};
    transform: translateY(-2px);
    box-shadow: ${props => props.theme.shadows.button};
  }

  &:active {
    transform: translateY(0);
  }

  &:disabled {
    background: ${props => props.theme.colors.disabled};
    cursor: not-allowed;
    transform: translateY(0);
    box-shadow: none;
  }
`;

const ErrorMessage = styled(motion.div)`
  color: ${props => props.theme.colors.error};
  margin-bottom: 1.5rem;
  text-align: center;
  padding: 0.75rem 1rem;
  background: ${props => props.theme.colors.errorBg || 'rgba(176, 0, 32, 0.1)'};
  border-radius: ${props => props.theme.borderRadius.small};
  font-size: 0.9rem;
  border-left: 3px solid ${props => props.theme.colors.error};
`;

const AdminLogin = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [localError, setLocalError] = useState('');
  const { login } = useAuth();
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setLocalError('');

    try {
      console.log('Attempting login with:', { email });
      const response = await login(email, password);
      console.log('Login response:', response);

      if (response?.user?.role === 'admin') {
        navigate('/admin/dashboard');
      } else {
        setLocalError('Access denied. Admin privileges required.');
      }
    } catch (error) {
      console.error('Login error:', error);
      setLocalError(error.message || 'Login failed. Please check your credentials.');
    } finally {
      setIsLoading(false);
    }
  };

  // Animation variants
  const containerVariants = {
    initial: { opacity: 0 },
    animate: { opacity: 1, transition: { duration: 0.5 } }
  };

  const formVariants = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0, transition: { duration: 0.5, delay: 0.2 } }
  };

  const inputVariants = {
    initial: { opacity: 0, x: -20 },
    animate: custom => ({ 
      opacity: 1, 
      x: 0, 
      transition: { duration: 0.4, delay: 0.3 + (custom * 0.1) } 
    })
  };

  const errorVariants = {
    initial: { opacity: 0, height: 0, margin: 0 },
    animate: { opacity: 1, height: 'auto', marginBottom: '1.5rem', transition: { duration: 0.3 } },
    exit: { opacity: 0, height: 0, margin: 0, transition: { duration: 0.3 } }
  };

  return (
    <LoginContainer>
      <BackgroundGradient 
        variants={containerVariants}
        initial="initial"
        animate="animate"
      />
      <BackgroundBlur 
        initial={{ opacity: 0, x: -300, y: -200 }}
        animate={{ opacity: 0.2, x: -100, y: -100, transition: { duration: 1.5 } }}
      />
      <BackgroundBlur 
        initial={{ opacity: 0, x: 300, y: 300 }}
        animate={{ opacity: 0.2, x: 100, y: 200, transition: { duration: 1.5 } }}
      />

      <LoginForm 
        onSubmit={handleSubmit}
        variants={formVariants}
        initial="initial"
        animate="animate"
      >
        <Title>
          Tech<span>Veda</span> Admin
        </Title>

        {localError && (
          <ErrorMessage
            variants={errorVariants}
            initial="initial"
            animate="animate"
            exit="exit"
          >
            {localError}
          </ErrorMessage>
        )}

        <FormGroup 
          variants={inputVariants}
          custom={0}
          initial="initial"
          animate="animate"
        >
          <Label htmlFor="email">Email</Label>
          <Input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="admin@example.com"
            required
          />
        </FormGroup>

        <FormGroup 
          variants={inputVariants}
          custom={1}
          initial="initial"
          animate="animate"
        >
          <Label htmlFor="password">Password</Label>
          <Input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="••••••••"
            required
          />
        </FormGroup>

        <Button 
          type="submit" 
          disabled={isLoading}
          whileTap={{ scale: 0.98 }}
          whileHover={{ y: -2 }}
        >
          {isLoading ? 'Logging in...' : 'Login'}
        </Button>
      </LoginForm>
    </LoginContainer>
  );
};

export default AdminLogin;
